function PopupInput(props) {
  return (
    <input
      id="name-input"
      className="popup__input profile-form__item profile-form__name"
      name="Name"
      type="text"
      placeholder={
        props.name == "editProfilePopup"
          ? "Name"
          : props.name == "addPlacePopup"
          ? "Title"
          : "Profile Image URL"
      }
      minLength="2"
      maxLength="40"
      required
    />
  );
}

export default PopupInput;
